	public void attTest() {
		GeneralDataFrame gf = new ServiceDataFrame();
		gf.attr = 0x13;
		System.out.println("1 ==> " + Hex.decode(new byte[] { gf.attr }));

		gf.setAttrByte(GeneralDataConstants.ATTR_COMPRESS);
		System.out.println("2 ==> " + Hex.decode(new byte[] { gf.attr }));

		gf.setAttrByte(GeneralDataConstants.ATTR_COMPRESS, false);
		System.out.println("3 ==> " + Hex.decode(new byte[] { gf.attr }));
	}

